import "./landing.css";

export default function Landing() {
	return (
		<section id="Landing" className="h-screen bg-[length:100%_100%]">
			<div className="grid grid-cols-12">
				<div className="col-span-1">
					<div className="subHead bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 bg-clip-text text-transparent text-5xl">
						"Tech it Easy"
					</div>
				</div>
			</div>
		</section>
	);
}
